import React from "react";
import styleCard from './Card.module.css'
export default function Card ({id, info, name, price, waist, image}){
    return (
        <div className = {styleCard.card}>
            <h3>{name}</h3>
            <h3>{id}</h3>
            <h3>{info}</h3>
            <h3>{price}</h3>
            <h3>{waist}</h3>
            <img src={image} alt='not found' ></img>
        </div>
    )
}
